import './Landing.css';
import React from 'react';
import SimpleAppBar from './components/SimpleAppBar';

function Landing() {
    return (
      <React.Fragment>
        <body>
        <SimpleAppBar />
        <div className="Landing">
            <p>
              E
            </p>
        </div>
        <div>
            <p>
              Contact
            </p>
        </div>
        </body>
      </React.Fragment>
    );
  }
  
  export default Landing;
